import React from 'react';
import { View, StyleSheet, Image, TouchableOpacity } from 'react-native';
import { Text } from 'react-native-web';
import { useNavigation } from '@react-navigation/native';

function CardUsuario({ usuario }) {
  const navigation = useNavigation();

  function abrirDetalhes() {
    navigation.navigate('tDetalhes', { usuario });
  }

  return (
    <TouchableOpacity style={styles.view} onPress={abrirDetalhes}>
      <View style={styles.view2}>
        <Text style={styles.textname}>{usuario.nome}</Text>
        
      </View>
    </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
    view: {
      padding: 20,
      backgroundColor: 'white',
      borderRadius: 15,
      marginVertical: 10,
      marginLeft: 20,
      marginRight: 20
    },

    view2: {
      marginLeft: 100,
      textAlign: 'center'
    },

    view3: {
      marginTop: 20
    },

    imgcontainer: {
      border: 200,
      borderColor: 'Black',
      borderRadius: 100,
      marginRight: 210,
      marginTop: -115,
      width: 120,
      height: 120
    },

    textname: {
      fontSize: 18,
      marginRight: 110,
      fontFamily: 'Ubuntu_700Bold'
    },

    textpreco: {
      fontSize: 15,
      marginLeft: 150,

    },

    textdistancia: {
      marginRight: 110,
    },


  });

export default CardUsuario;
